public static ByteBuffer persistZip(String loc, Class... classes) throws IOException {
  ByteBuffer jar = generateZip(classes);
  try (FileOutputStream fos = new FileOutputStream(loc)) {
    fos.write(jar.array(), 0, jar.limit());
    fos.flush();
  }
  return jar;
}

